import { INCREMENT, DECREMENT, SET_PRODUCTS } from "./counter.types";

export const increaseCounter = (products) => {
    return {
        type: INCREMENT,
    };
};

export const decreaseCounter = () => {
    return {
        type: DECREMENT,
    };
};

export const setProducts = () => {
    return {
        type: SET_PRODUCTS,
        payload: products
    }
}
